This measurement provides the total number of discarded IP packets due to Bucket
              Full. The counter is increased when the BSS Cell bucket is full; the BSS MS bucket is full;
              and when the BSS PFC bucket is full.

This measurement provides the number of Released messages sent. It is registered
              for SGSN (G) if the NumberOfConnections SCCP parameter is > 0 for any local SAP instance,
              but it is not applicable for SGSN (G).
